import React, { Component } from "react";
import Slider from "react-slick";
import projectContent from "./ProjectContent"





export default class Resizable extends Component {

  constructor(props) {
    super(props);
    this.next = this.next.bind(this);
    this.previous = this.previous.bind(this);
  }

  next() {
    this.slider.slickNext();
  }
  previous() {
    this.slider.slickPrev();
  }
  state = {
    display: true,
    width: 600,
    info :[{id:"1",img:womenone,title:"New Green Jacket",price:"$75"},
    {id:"2",img:womentwo, title:"Classic Dress",price:"$45"},
    {id:"3",img:womenthree,title:"Spring Collection",price:"$130"},
    {id:"4",img:womenfour,title:"Lorem Ipsum",price:"$157"},
    


            
     
  ]
  };
  render() {


    const settings = {
      arrows:false,
      dots: false,
      infinite: true,
      speed: 500,
      slidesToShow: 3,
      slidesToScroll: 1,
      responsive: [
        {
          breakpoint: 1199,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 1,
            infinite: true,
            dots: false
          }
        },
        {
          breakpoint: 991,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1,
            infinite: true,
            dots: false
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1,
            initialSlide: 1
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        },
        {
          breakpoint: 395,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        
        },
        {
          breakpoint: 320,
          settings: {
            slidesToShow: .95,
            slidesToScroll: 1
          }
        }
      ]
    };
    const project = this.state.info.map(function(i){
      return <projectContent />
   })
    return (
   
          <div className="container slider-container" style={{marginTop:"50px"}}>
               <button className="button next-button" onClick={this.next}>
               <ArrowForwardIosIcon/>
          </button>
          <button className="button prev-button" onClick={this.previous}>
          <ArrowBackIosIcon/>
          
          </button>
        <Slider ref={c => (this.slider = c)} {...settings}>

      
       
           
        {project}
          </Slider>
        
          </div>
    );
  }
}
